public class Solution_5461 {
    public int numSub(String s) {
        Long res = 0L;
        String[] split = s.split("0");
        if(split.length == 0){
            return res.intValue();
        }
        for (int i = 0; i < split.length; i++) {
            res += count(split[i].length());
        }
        return (int) (res%1000000007);

    }

    public Long count(int len){
        Long sum = 0L;
        for (int i = 1; i <= len; i++) {
            sum+=i;

        }
        return sum;
    }

    public static void main(String[] args) {
        Solution_5461 s = new Solution_5461();
//        System.out.println(s.numSub("\"\""));
        System.out.println(s.count(100000));
    }
}
